INSERT INTO `news` VALUES (1,1,'Ngy Th thao trng hc','Hy tham gia cng chng ti vo mt ngy hot ng th thao hp dn!','https://onlinefirstaid4e88.b-cdn.net/wp-content/uploads/2019/06/school-sports-day-scaled.jpeg.bv_resized_desktop.jpeg.bv.webp?bv_host=onlinefirstaid.com','2023-10-22 17:18:52','2023-12-30 04:09:28'),(2,1,'Khu ging ng 3 Trng i hc Cng ngh chnh thc i vo hot ng',' Ngy 01/10/2018, Khu ging ng 3 ca Trng i hc Cng ngh ti tng 2 ta nh Detech s 8, Tn Tht Thuyt, H Ni chnh thc i vo vn hnh.\n\n     Khu ging ng c din tch 1300 m2 gm 15 phng hc c sc cha t 40-60 ch ngi, p ng quy m 700 sinh vin/ca hc. Cc phng hc c thit k, u t mi ng b, hin i p ng tiu chun cht lng cao: h thng iu ha trung tm; h thng ca knh cch m v cch nhit  m bo mi trng hc tp yn tnh; h thng n LED chiu sng; cc lp hc c trang b my chiu, bng trt hai lp v bn gh mi.\n\n     Khng gian snh ni gia cc phng hc c thit k rng, thong p ng nhu cu ngh gia gi v cc hot ng tp th, giao lu ca sinh vin. Cng vi h tng tt m bo cho cng tc ging dy v nghin cu, khu ging ng mi ca Trng cn nm trn a bn c h tng giao thng thun li, cnh quan p, khng kh trong lnh, gn cc trng i hc ln. y l iu kin tt  to ra s giao lu, lin kt trong hc tp v sinh hot ca cng ng sinh vin.\n\n     Vi vic u t tng cng c s vt cht p ng yu cu cht lng cao ca cng tc dy v hc, hin ti Trng i hc Cng ngh c 03 khu ging ng vi tng din tch 4500 m2 vi gn 40 phng hc. Di y l mt s hnh nh ca khu ging ng mi ti tng 2, ta Nh Detech, s 8 Tn Tht Thuyt, H Ni.','','2023-10-22 17:18:52','2023-12-30 15:28:26'),(3,1,'S kin Tnh nguyn cng ng','Hy tham gia tnh nguyn  to nh hng tch cc n cng ng.','https://familyhouseinc.org/wp-content/uploads/2019/10/summer-high-school-volunteer-program-250x140.jpg','2023-10-22 17:18:52','2023-12-30 04:13:36'),(5,1,'What is Lorem Ipsum?','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.','team-business-people-stacking-hands.jpg','2023-12-30 15:35:26','2023-12-30 15:36:30');
